import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const initialShot = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: initialShot });
    screenshots.push(initialShot);

    // Find a "Your Profile" link using text selector (first occurrence)
    await page.waitForSelector('a:has-text("Your Profile")', { timeout: 5000 });
    const profileLinks = await page.$$('a:has-text("Your Profile")');
    let profileLinkText = null;
    if (profileLinks.length > 0) {
      profileLinkText = await profileLinks[0].innerText();
      // Scroll into view and click the first "Your Profile" link
      await profileLinks[0].scrollIntoViewIfNeeded();
      await profileLinks[0].click();
    }

    // Take screenshot after clicking "Your Profile"
    const afterProfileClickShot = path.join(screenshotsDir, 'step_2_after_profile_click.png');
    await page.screenshot({ path: afterProfileClickShot });
    screenshots.push(afterProfileClickShot);

    // Wait for a profile page indicator (look for Jun's profile image by alt attribute or src)
    // Try several selector strategies
    let profileImageUrl = null;
    let profileName = null;
    let profileUsername = null;
    let profileBio = null;
    let profileStats = {};

    // Wait for possible profile page content (look for .profile-header)
    try {
      await page.waitForSelector('.profile-header', { timeout: 5000 });

      // Extract profile image
      const imgEl = await page.$('.profile-header img.profile-image');
      if (imgEl) {
        profileImageUrl = await imgEl.getAttribute('src');
      }

      // Extract full name
      const nameEl = await page.$('.profile-header .profile-info h2');
      if (nameEl) {
        profileName = (await nameEl.innerText()).trim();
      }

      // Extract username
      const usernameEl = await page.$('.profile-header .profile-info .username');
      if (usernameEl) {
        profileUsername = (await usernameEl.innerText()).replace(/^@/, '').trim();
      }

      // Extract bio
      const bioEl = await page.$('.profile-header .profile-info .bio');
      if (bioEl) {
        profileBio = (await bioEl.innerText()).trim();
      }

      // Extract stats (Orders, Reviews, Seller Rating)
      const statEls = await page.$$('.profile-header .profile-info .profile-stats .stat');
      if (statEls.length >= 3) {
        const statNumbers = await Promise.all(statEls.map(async el => {
          const numEl = await el.$('.stat-number');
          const labelEl = await el.$('.stat-label');
          return {
            number: numEl ? (await numEl.innerText()).trim() : null,
            label: labelEl ? (await labelEl.innerText()).trim() : null
          };
        }));
        for (const stat of statNumbers) {
          if (stat.label && stat.number) {
            profileStats[stat.label] = stat.number;
          }
        }
      }
    } catch (e) {
      // Profile section not found, leave fields as null
    }

    // Take screenshot of profile section if found
    const profileSectionShot = path.join(screenshotsDir, 'step_3_profile_section.png');
    await page.screenshot({ path: profileSectionShot });
    screenshots.push(profileSectionShot);

    // Extract Jun's recent reviews (look for .reviews-list .review-item)
    let junReviews = [];
    try {
      await page.waitForSelector('.reviews-list .review-item', { timeout: 3000 });
      const reviewEls = await page.$$('.reviews-list .review-item');
      for (const reviewEl of reviewEls) {
        const productTitleEl = await reviewEl.$('.review-product-title');
        const reviewTitleEl = await reviewEl.$('.review-title');
        const reviewContentEl = await reviewEl.$('.review-content');
        const reviewDateEl = await reviewEl.$('.review-date');
        const reviewRatingEl = await reviewEl.$('.stars');
        junReviews.push({
          product: productTitleEl ? (await productTitleEl.innerText()).trim() : null,
          title: reviewTitleEl ? (await reviewTitleEl.innerText()).replace(/"/g, '').trim() : null,
          content: reviewContentEl ? (await reviewContentEl.innerText()).trim() : null,
          date: reviewDateEl ? (await reviewDateEl.innerText()).trim() : null,
          ratingStars: reviewRatingEl ? (await reviewRatingEl.innerText()).trim() : null
        });
      }
    } catch (e) {
      // No reviews found
    }

    // Extract Jun's products (look for .products-grid inside .profile-sections)
    let junProducts = [];
    try {
      const junProductsGrid = await page.$('.profile-sections .section .products-grid');
      if (junProductsGrid) {
        const productCards = await junProductsGrid.$$('.product-card');
        for (const card of productCards) {
          const titleEl = await card.$('.product-title');
          const priceEl = await card.$('.product-price');
          const sellerEl = await card.$('.seller-info');
          junProducts.push({
            title: titleEl ? (await titleEl.innerText()).trim() : null,
            price: priceEl ? (await priceEl.innerText()).replace(/\n.*/,'').trim() : null,
            seller: sellerEl ? (await sellerEl.innerText()).replace(/^by /, '').trim() : null
          });
        }
      }
    } catch (e) {
      // No Jun's products found
    }

    return {
      success: true,
      action: "Harvested Jun's user profile information, stats, reviews, and products",
      extractedData: {
        profileLinkText,
        profileName,
        profileUsername,
        profileBio,
        profileImageUrl,
        profileStats,
        junProducts,
        junReviews
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
